package model;

public class Procedimentos {

	private String limpeza;
	private String enzimascap;
	private String preenchimento;
	private String toxina;
	private String drenagem;
	private String depilacao;
	private String microvasos;
	private String criolipolise;
	private String enzimascorpo;
	public Procedimentos() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Procedimentos(String limpeza, String enzimascap, String preenchimento, String toxina, String drenagem, String depilacao, String microvasos, String criolipolise, String enzimascorpo) {
		super();
		this.limpeza = limpeza;
		this.enzimascap = enzimascap;
		this.preenchimento = preenchimento;
		this.toxina = toxina;
		this.drenagem = drenagem;
		this.depilacao = depilacao;
		this.microvasos = microvasos;
		this.criolipolise = criolipolise;
		this.enzimascorpo = enzimascorpo;
	}
	public String getLimpeza() {
		return limpeza;
	}
	public void setLimpeza(String limpeza) {
		this.limpeza = limpeza;
	}
	public String getEnzimascap() {
		return enzimascap;
	}
	public void setEnzimascap(String enzimascap) {
		this.enzimascap = enzimascap;
	}
	public String getPreenchimento() {
		return preenchimento;
	}
	public void setPreenchimento(String preenchimento) {
		this.preenchimento = preenchimento;
	}
	public String getToxina() {
		return toxina;
	}
	public void setToxina(String toxina) {
		this.toxina = toxina;
	}
	public String getDrenagem() {
		return drenagem;
	}
	public void setDrenagem(String drenagem) {
		this.drenagem = drenagem;
	}

	public String getDepilacao() {
		return depilacao;
	}
	public void setDepilacao(String depilacao) {
		this.depilacao = depilacao;
	}
	public String getMicrovasos() {
		return microvasos;
	}
	public void setMicrovasos(String microvasos) {
		this.microvasos = microvasos;
	}
	public String getCriolipolise() {
		return criolipolise;
	}
	public void setCriolipolise(String criolipolise) {
		this.criolipolise = criolipolise;
	}
	public String getEnzimascorpo() {
		return enzimascorpo;
	}
	public void setEnzimascorpo(String enzimascorpo) {
		this.enzimascorpo = enzimascorpo;
	}
	
	
}

